export default function Hero() {
  return (
    <div className="hero">
      <h1>Javascript</h1>
      <section>
        <pre>
          <code className="language-javascript">
            const foo = 'bar';
            let count = 0;
            count += 1;
            console.log('Foo:', foo);
          </code>
        </pre>
      </section>
    </div>
  )
}
